import React from 'react';
// import { Link } from 'react-router-dom';
import Absent from '../../weatherIcon/Absent.svg'
import high from '../../weatherIcon/high.svg'
import moderate from '../../weatherIcon/moderate.svg'
import veryhight from '../../weatherIcon/veryhigh.svg'
import low from '../../weatherIcon/low.svg'


function annualDateCards(props) {
    // const citycode = props.citycode
    // const MAXtemperature = "TEMPMAX_fcast_" + citycode
    // const MINtemperature = "TEMPMIN_fcast_" + citycode
    // const AVAtemperature = "TEMPMEDIA_fcast_" + citycode
    // const rainfall = "fcast_class_" + citycode
    // const rainorno = "rained_" + citycode + "_yN"
    // const icon = "icon_" + citycode

    function weathericon() {
        const findweatericon = props.data.icon_B17
        const image = {Absent}
        if(findweatericon == "veryhigh"){
            image = {veryhight}
        }else if (findweatericon == "low"){
            image = {low}
        }else if (findweatericon == "Absent"){
            image = {Absent}
        }else if(findweatericon == "moderate"){
            image = {moderate}
        }
        return image
    }

    return (   

        <div className="col-md-3">
            <img src={Absent} alt=""/>
            <p>Max Temp : {props.data.TEMPMAX_fcast_B17}</p>
            <p>Min Temp : {props.data.TEMPMIN_fcast_B17}</p>
            <p>Precipitation : {props.data.fcast_class_B17}</p>
            <p>Rain: {props.data.rained_B17_yN}</p>    
        </div>

    )
}

export default annualDateCards;
